float3 r = float3($rx, $ry, $rz);
float32 k0 = length(p/r);
float32 k1 = length(p/(r*r));

return k0 * (k0 - 1.0f) / k1;

complex c = complex(-0.745, 0.186);
complex z;
#ifdef PROGRAM_DRAW
  z = 2.0 * complex(gl_FragCoord.x / params.resolution.x, gl_FragCoord.y / params.resolution.y) - 1.0;
#endif

complex dz = complex(1.0, 0.0); // derivate of z

float32 zlen2 = 0.0f;
for(int32 i = 0; i < 16; i++)
{
	dz = 2.0 * complexMult(z, dz);
	z = complexMult(z, z) + c;
	zlen2 = complexLen2(z);
	if(zlen2 > 1000) break;
}

return sqrt(clamp(
		(150 / params.time) * sqrt(zlen2 / complexLen2(dz)) * 0.5 * log(zlen2),
		0.0, 1.0));

float32 O = cos(params.time) * 3.1415926;
float32 cosO = cos(O);
float32 sinO = sin(O);

return float3(p.x * cosO + p.z * sinO,
			  p.y,
			  -sinO * p.x + cosO * p.z);

